"413362":{"id":"413362","name":"Roman J. Israel","slug":"roman-j-israel","original_title":"Roman J. Israel, Esq.","overview":"Roman J. Israel é um advogado determinado e honesto, que sofre psicologicamente por sempre ver os outros ganharem crédito por seu bom trabalho. Depois que um dos sócios de uma grande firma morre, ele é convidado a assumir a direção no lugar do executivo. O que ele não imaginava é que descobriria um esquema dos mais sujos nos bastidores do poder - e que, caso ele não tome medidas drásticas, os danos serão irreversíveis.","first_air_date":"2017-11-17","runtime":122,"episode_run_time":[122],"vote_average":6.3,"created_by":["Culture China - Image Nation Abu Dhabi Fund","Cross Creek Pictures","Bron Studios","Escape Artists","Image Nation Abu Dhabi","MACRO","Topic Studios","Columbia Pictures"],"production_companies":[{"name":"Culture China - Image Nation Abu Dhabi Fund"},{"name":"Cross Creek Pictures"},{"name":"Bron Studios"},{"name":"Escape Artists"},{"name":"Image Nation Abu Dhabi"},{"name":"MACRO"},{"name":"Topic Studios"},{"name":"Columbia Pictures"}],"cast":["Denzel Washington","Colin Farrell","Carmen Ejogo","Lynda Gravatt","Amanda Warren"],"backdrop_path":"https://image.tmdb.org/t/p/original/w2pGoOHNVESZwlSI3xYk4OdEb91.jpg","poster_path":"https://image.tmdb.org/t/p/original/ciq2V1G4dj3GLFBfQGY1gqvPcbK.jpg","certification":"N/A","genres":["Drama","Crime","Thriller"],"trailer":"N/A"},
