"758724":{"id":"758724","name":"Descida ao Inferno","slug":"descida-ao-inferno","original_title":"The Cellar","overview":"Keira (Elisha Cuthbert) e Brian Woods (Eoin Macken) recentemente compraram uma mansão isolada em um leilão. Agora eles estão ansiosos para começar uma nova vida lá com seus filhos, a adolescente Ellie (Abby Fitz) e o pequeno Steve (Dylan Fitzmaurice Brady). Ellie não está feliz com a mudança, tendo que deixar seus amigos e tudo o que sabe para trás. Além disso, na primeira noite na nova casa, os pais extrovertidos confiam a ela o cuidado do irmãozinho. Quando a energia acaba naquela noite, Ellie vai até a caixa de fusíveis no porão, um lugar misterioso e escuro do qual ela tem muito medo. Quando a mãe e o pai voltam para casa, a menina desaparece sem deixar vestígios. Assolada pela culpa, Keira encontra símbolos e números misteriosos no porão e acima de cada porta de sua nova casa. Com a ajuda do professor de matemática Remy (Aaron Monaghan), ela começa a desvendar o segredo diabólico da casa na esperança de salvar sua filha.","first_air_date":"2022-03-25","runtime":94,"episode_run_time":[94],"vote_average":6.5,"created_by":["Savage Productions","Hail Mary Pictures","Epic Pictures Group","Wrong Men","BNP Paribas Fortis","BCP Asset Management","Fís Éireann/Screen Ireland"],"production_companies":[{"name":"Savage Productions"},{"name":"Hail Mary Pictures"},{"name":"Epic Pictures Group"},{"name":"Wrong Men"},{"name":"BNP Paribas Fortis"},{"name":"BCP Asset Management"},{"name":"Fís Éireann/Screen Ireland"}],"cast":["Elisha Cuthbert","Eoin Macken","Dylan Fitzmaurice-Brady","Tara Lee","Michael-David McKernan"],"backdrop_path":"https://image.tmdb.org/t/p/original/cK6M84mqSwbjzwFAinrANbdZyln.jpg","poster_path":"https://image.tmdb.org/t/p/original/o9oIqWFKcZirEDzjj6Ie92G60j0.jpg","certification":"12","genres":["Terror","Mistério"],"trailer":"gXhgw0KKriE"},
