"4251":{"id":"4251","name":"Veer-Zaara","slug":"veer-zaara","original_title":"वीर-ज़ारा","overview":"Saamiya Siddiqui, é uma jovem advogada paquistanesa que pega como primeiro caso algo impossível de vencer. O acusado, Veer, não fala com ninguém durante os vinte e dois anos que passou preso, porém, por ter sido tratado com dignidade por Saamiya, Veer, lhe conta sua história de amor, da Índia ao Paquistão, e também sobre sua amada, Zaara.","first_air_date":"2004-11-12","runtime":192,"episode_run_time":[192],"vote_average":7.4,"created_by":["Yash Raj Films","Veer Zaara Pictures"],"production_companies":[{"name":"Yash Raj Films"},{"name":"Veer Zaara Pictures"}],"cast":["शाहरुख़ ख़ान","Preity Zinta","Rani Mukerji","Amitabh Bachchan","Hema Malini"],"backdrop_path":"https://image.tmdb.org/t/p/original/emjsLzI7WwCfcEFty4yvA3Bm5AA.jpg","poster_path":"https://image.tmdb.org/t/p/original/j267YqLvKAHeyykTflxzpgVgviQ.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
