"401898":{"id":"401898","name":"Thelma","slug":"thelma","original_title":"Thelma","overview":"Thelma é uma jovem e tímida garota que acaba de deixar a casa dos pais para estudar em Oslo, onde começa a viver seu primeiro amor. Seu relacionamento logo é afetado pela intromissão opressiva de sua família, que com suas crenças religiosas fundamentalistas conseguem abalar a vida da jovem. Quando Thelma fica chateada, coisas estranhas começam a acontecer e esses fenômenos sobrenaturais só aumentam. Enquanto busca respostas sobre esses poderes que ela não consegue controlar, seus pais severos e religiosos se preparam para o pior.","first_air_date":"2017-09-15","runtime":116,"episode_run_time":[116],"vote_average":6.8,"created_by":["Motlys","Film i Väst","Le Pacte","Filmpool Nord","Snowglobe","B-Reel Films","Don't Look Now","Copenhagen Film Fund","Memento Films International"],"production_companies":[{"name":"Motlys"},{"name":"Film i Väst"},{"name":"Le Pacte"},{"name":"Filmpool Nord"},{"name":"Snowglobe"},{"name":"B-Reel Films"},{"name":"Don't Look Now"},{"name":"Copenhagen Film Fund"},{"name":"Memento Films International"}],"cast":["Eili Harboe","Kaya Wilkins","Henrik Rafaelsen","Ellen Dorrit Petersen","Grethe Eltervåg"],"backdrop_path":"https://image.tmdb.org/t/p/original/5hUs9S32uF24jnCfaMm6gWzEbxH.jpg","poster_path":"https://image.tmdb.org/t/p/original/l3ciaQdEBQdlOP2Bkc7BV7VkPdK.jpg","certification":"16","genres":["Drama","Mistério","Thriller"],"trailer":"k7dM9adQFV4"},
