"1577":{"id":"1577","name":"Resident Evil 2: Apocalipse","slug":"resident-evil-2-apocalipse","original_title":"Resident Evil: Apocalypse","overview":"Depois de escapar com grande dificuldade dos horrores das instalações subterrâneas da Hive, Alice é empurrada de volta para a guerra feroz entre os vivos e os não-mortos. Enquanto a cidade está isolada sob quarentena, Alice se junta a uma pequena equipe de soldados de elite comandada por Valentine e Carlos que tem a missão de resgatar a filha desaparecida do Dr. Ashford, o criador do vírus T-mutante. Será uma emocionante corrida contra o tempo, enquanto o grupo enfrenta hordas de zumbis sedentos de sangue, sanguessugas escondidas, cães mutantes e os mais sinistros inimigos.","first_air_date":"2004-09-10","runtime":93,"episode_run_time":[93],"vote_average":6.4,"created_by":["Davis Films/Impact Pictures","Screen Gems","Constantin Film"],"production_companies":[{"name":"Davis Films/Impact Pictures"},{"name":"Screen Gems"},{"name":"Constantin Film"}],"cast":["Milla Jovovich","Sienna Guillory","Oded Fehr","Thomas Kretschmann","Sophie Vavasseur"],"backdrop_path":"https://image.tmdb.org/t/p/original/5PJP3NaiH9ZJRzrEHLeqSY5rNxb.jpg","poster_path":"https://image.tmdb.org/t/p/original/r8q9pCcpzclyg2NjOt7DRbHRvG9.jpg","certification":"16","genres":["Terror","Ação","Ficção científica"],"trailer":"gTgdzx_CTPk"},
"9448":{"id":"9448","name":"Tiro e Queda","slug":"tiro-e-queda","original_title":"The Big Hit","overview":"Para pagar a dívida de sua segunda namorada, o assassino Melvin Smiley aceita um trabalho de sequestro com seus companheiros habituais. Em seu mundo de futuros sogros judaicos e multas por filmes não devolvidos, o assassino se apaixona pela vítima e precisa acertar as contas com aqueles que cruzarem seu caminho.","first_air_date":"1998-04-24","runtime":92,"episode_run_time":[92],"vote_average":6.0,"created_by":["TriStar Pictures","Lion Rock Productions","Amen Ra Films"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Lion Rock Productions"},{"name":"Amen Ra Films"}],"cast":["Mark Wahlberg","Lou Diamond Phillips","Christina Applegate","China Chow","Avery Brooks"],"backdrop_path":"https://image.tmdb.org/t/p/original/as1NA7hA1GwUN4Bq3ZQiVQST1xU.jpg","poster_path":"https://image.tmdb.org/t/p/original/AkYRgFPMFVDV9Ki5keAjYqpxVZ1.jpg","certification":"N/A","genres":["Ação","Aventura","Comédia","Crime","Thriller"],"trailer":"N/A"},
"6081":{"id":"6081","name":"A Vingança da Pantera Cor-de-Rosa","slug":"a-vinganca-da-pantera-cor-de-rosa","original_title":"Revenge of the Pink Panther","overview":"Jacques Clouseau (Peter Sellers), o famoso detetive, é pego em uma emboscada por Philippe Douvier, que decide matá-lo. Só que Clouseau é mais esperto e consegue escapar, porém sua morte é anunciada na mídia, o que leva a todos acharem que ele está realmente morto. O detetive francês passa a tirar vantagem dessa situação e arma um plano na encolha para saber quem armou pra cima dele.","first_air_date":"1978-01-08","runtime":99,"episode_run_time":[99],"vote_average":6.4,"created_by":["United Artists","Jewel Productions","Sellers-Edwards productions","Pimlico Films"],"production_companies":[{"name":"United Artists"},{"name":"Jewel Productions"},{"name":"Sellers-Edwards productions"},{"name":"Pimlico Films"}],"cast":["Peter Sellers","Herbert Lom","Dyan Cannon","Robert Webber","Robert Loggia"],"backdrop_path":"https://image.tmdb.org/t/p/original/uizfVRkjqjTUcPu1rhb2Up10gwp.jpg","poster_path":"https://image.tmdb.org/t/p/original/k82O9m5yJqx29HRSay38XumhSIW.jpg","certification":"N/A","genres":["Comédia","Crime","Mistério"],"trailer":"N/A"},
"10426":{"id":"10426","name":"A Mais Louca Sexta-Feira em Apuros","slug":"a-mais-louca-sexta-feira-em-apuros","original_title":"Friday After Next","overview":"Embora os primos Craig (Ice Cube) e Day-Day (Mike Epps) tenham deixado para trás a segurança de viver com seus pais, o velho apartamento que hoje eles estão dividindo está cheio de equipamentos e do espírito de férias do Natal. O clima de alegria e confraternização domina... até que um falso Papai Noel arromba o apartamento e rouba seus presentes de Natal e tudo mais que ele consegue colocar dentro do enorme saco, inclusive o dinheiro para pagar o aluguel que estava escondido dentro da caixa acústica do aparelhos de som. Diante dessa triste realidade de um Natal sem presentes e com ameaça de despejo, se eles não pagarem o aluguel até o dia do vencimento - sua única esperança de ganhar algum dinheiro , e rápido, acaba levando-os à rua do strip-tease da região, onde eles conseguem um emprego como seguranças. Durante essa inusitada experiência, Craig e Day-Day aprendem algumas divertidas lições sobre o verdadeiro significado das férias e do Natal.","first_air_date":"2002-11-22","runtime":85,"episode_run_time":[85],"vote_average":6.3,"created_by":["New Line Cinema","Cube Vision"],"production_companies":[{"name":"New Line Cinema"},{"name":"Cube Vision"}],"cast":["Ice Cube","Mike Epps","John Witherspoon","Don Curry","Anna Maria Horsford"],"backdrop_path":"https://image.tmdb.org/t/p/original/bfnQPbcmPAXO2QmDONalx4vNWPB.jpg","poster_path":"https://image.tmdb.org/t/p/original/92NaYp6Gpcc1e36WMbUlCVGZQPT.jpg","certification":"18","genres":["Comédia"],"trailer":"N/A"},
