"11535":{"id":"11535","name":"Rollerball","slug":"rollerball","original_title":"Rollerball","overview":"Em 2005 o esporte mais popular é o rollerball, um jogo violento e por vezes mortal que envolve skates e motos e é jogado em arenas espalhadas ao redor do planeta. Os principais astros do rollerball são Jonathan Cross (Chris Klein), Marcus Ridley (LL Cool J) e Aurora (Rebecca Romjin-Stamos), que decidem denunciar a corrupção existente por trás dos jogos após descobrirem que Aleci Petrovich (Jean Reno), o dono do principal time do rollerball, é capaz de fazer qualquer coisa para manipular os resultados dos jogos ao seu bel prazer. Porém, ao saber da intenção de Jonathan e seus colegas Aleci logo arma um plano para eliminar todas as provas existentes contra ele, incluindo os três jogadores.","first_air_date":"2002-02-08","runtime":98,"episode_run_time":[98],"vote_average":4.0,"created_by":["Atlas Entertainment","TOHO-TOWA","Mosaic Media Group","Yorktown Productions","Helkon Media","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Atlas Entertainment"},{"name":"TOHO-TOWA"},{"name":"Mosaic Media Group"},{"name":"Yorktown Productions"},{"name":"Helkon Media"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Chris Klein","LL Cool J","Rebecca Romijn","Naveen Andrews","Jean Reno"],"backdrop_path":"https://image.tmdb.org/t/p/original/xnBZxfqR6EqbrIyb3yfU1w90n6q.jpg","poster_path":"https://image.tmdb.org/t/p/original/5Wquo3EjfDpK7S1BHcybuC3TZDO.jpg","certification":"N/A","genres":["Ação","Ficção científica","Thriller"],"trailer":"N/A"},
