"14397":{"id":"14397","name":"Reféns do Mal","slug":"refens-do-mal","original_title":"Whisper","overview":"Max (Josh Holloway) passou três anos preso e agora sonha em abrir um restaurante com a noiva, Roxanne. Mas a vida não é fácil para um ex-condenado e ele cai na tentação de um último trabalho com um velho amigo: sequestrar David, um inocente menino de 8 anos, filho único de uma viúva milionária. A ação é um sucesso. No cativeiro, no entanto , os sequestradores perdem o controle da situação quando começam a ouvir sussurros que revelam seus segredos, enquanto David levanta suspeitas de traições entre eles. Nas paredes do quarto, o menino vai desenhando os destinos trágicos de cada um. Apenas Max percebe que David não é apenas um veículo, mas sim o verdadeiro controlador dessas forças demoníacas que estão acabando com seu grupo. E sua vida passa a depender apenas de uma coisa: descobrir que poder é esse, controlar o incontrolável e exterminar o Mal.","first_air_date":"2007-11-27","runtime":94,"episode_run_time":[94],"vote_average":6.4,"created_by":["Universal Pictures","Gold Circle Films","H2F Entertainment","Yukon Film Incentive Program","Mandate International"],"production_companies":[{"name":"Universal Pictures"},{"name":"Gold Circle Films"},{"name":"H2F Entertainment"},{"name":"Yukon Film Incentive Program"},{"name":"Mandate International"}],"cast":["Blake Woodruff","Josh Holloway","Sarah Wayne Callies","Michael Rooker","Julian Christopher"],"backdrop_path":"https://image.tmdb.org/t/p/original/A4ZvbsC0o86bpgHa00iad1YCtu2.jpg","poster_path":"https://image.tmdb.org/t/p/original/qe8D3CMIg2wwxkLDZ9bNmyXz5CP.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
"10533":{"id":"10533","name":"A Letra Escarlate","slug":"a-letra-escarlate","original_title":"The Scarlet Letter","overview":"Na colônia de Massachusetts Bay, na Nova Inglaterra de 1666, época da colonização dos Estados Unidos, puritanos e índios algonquinos chegam a uma trégua em seus sangrentos conflitos. Diante desse pano de fundo, a jovem Hester chega da Inglaterra, engravida e se recusa veementemente a dizer o nome do pai da criança. A comunidade puritana na qual Hester vive não aceita essa escolha e a obriga a usar a letra A, de \"adúltera\", sempre visível sobre suas roupas.","first_air_date":"1995-10-13","runtime":135,"episode_run_time":[135],"vote_average":6.1,"created_by":["Cinergi Pictures","Lightmotive","Allied Stars","Moving Pictures","Hollywood Pictures"],"production_companies":[{"name":"Cinergi Pictures"},{"name":"Lightmotive"},{"name":"Allied Stars"},{"name":"Moving Pictures"},{"name":"Hollywood Pictures"}],"cast":["Demi Moore","Gary Oldman","Robert Duvall","Robert Prosky","Edward Hardwicke"],"backdrop_path":"https://image.tmdb.org/t/p/original/tZJIL1n3eGZd3mZyto3Ux2xNEBW.jpg","poster_path":"https://image.tmdb.org/t/p/original/o2qTYlB7N3W4btFfR8InAR8EAmM.jpg","certification":"N/A","genres":["Drama","Romance","Faroeste"],"trailer":"N/A"},
