"9058":{"id":"9058","name":"Só Você","slug":"so-voce","original_title":"Only You","overview":"Faith é uma professora que acredita que sua alma gêmea é um homem chamado Damon Bradley, pois quando era garota este nome apareceu em uma tábua Ouija e também por ter sido predito por uma cigana. O tempo passou e ela vai se casar com um médico. Faltando poucos dias do casamento ela atende o telefonema de um amigo do seu noivo, que pede desculpas por não poder ir a cerimônia pois está partido naquele instante para Veneza. O nome do amigo era Damon Bradley, o que faz com que ela não pense duas vezes e decida ir até Veneza, tentando encontrar um homem que ela não conhece.","first_air_date":"1994-03-04","runtime":108,"episode_run_time":[108],"vote_average":6.8,"created_by":["TriStar Pictures","Yorktown Productions"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Yorktown Productions"}],"cast":["Marisa Tomei","Robert Downey Jr.","Bonnie Hunt","Joaquim de Almeida","Fisher Stevens"],"backdrop_path":"https://image.tmdb.org/t/p/original/8uAwA3xnpMyP6etx3JIjFouA4Cl.jpg","poster_path":"https://image.tmdb.org/t/p/original/kWqjQusXc0BKH8Yd55aG0Zytpdw.jpg","certification":"N/A","genres":["Romance","Comédia"],"trailer":"N/A"},
