"16985":{"id":"16985","name":"Legalmente Loiras","slug":"legalmente-loiras","original_title":"Legally Blondes","overview":"Elas são corajosas. Elas são LOIRAS e estão prestes a dominar a escola! Quando Annie e Izzy (Milly e Becky Rosso), as jovens e loiras primas de Elle Woods, se mudaram da Inglaterra para a Califórnia, elas acharam que suas roupinhas cor-de-rosa, seus cãezinhos de colo e suas habilidades sociais fariam com elas se integrassem imediatamente e se sentissem em casa. No entanto, acabam descobrindo que estão a quilômetros de distância da moda dos uniformes e da estrutura de poder baseada em dinheiro que vigora na sua nova escola. Quando as forças que imperam no território decidem detonar as garotas e acusá-las de um crime, Izzy e Annie precisam usar sua inteligência e charme para limpar seus nomes e mostrar à escola que na sala de aula ou no tribunal, nunca se deve subestimar o poder das loiras.","first_air_date":"2009-04-28","runtime":86,"episode_run_time":[86],"vote_average":5.7,"created_by":["Type A Films","Brookwell-McNamara Entertainment","Marc Platt Productions","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Type A Films"},{"name":"Brookwell-McNamara Entertainment"},{"name":"Marc Platt Productions"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Milly Rosso","Becky Rosso","Tanya Chisholm","Christopher Cousins","Brittany Curran"],"backdrop_path":"https://image.tmdb.org/t/p/original/zbZUhdztlBsOod9aDDBfkqbqJPd.jpg","poster_path":"https://image.tmdb.org/t/p/original/xezcCB9vBoVDAccVY8TtKgF5uzo.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
