"12662":{"id":"12662","name":"Psicose 3","slug":"psicose-3","original_title":"Psycho III","overview":"Norman Bates (Anthony Perkins) segue no comando de seu pequeno hotel. Para ajudá-lo nas tarefas do local ele contrata Duane (Jeff Fahey), um guitarrista que topa qualquer emprego por dinheiro. Ele tem duas novas hóspedes: Maureen Coyle (Diana Scarwid), que deixou há pouco tempo o convento em que vivia, e Tracy Venable (Roberta Maxwell), uma jornalista que está preparando um artigo sobre serial killers. Logo Norman se apaixona por Maureen, mas alguém vestido como sua mãe passa a matar as pessoas que rondam o hotel, uma a uma.","first_air_date":"1986-04-02","runtime":93,"episode_run_time":[93],"vote_average":5.6,"created_by":["Universal Pictures"],"production_companies":[{"name":"Universal Pictures"}],"cast":["Anthony Perkins","Diana Scarwid","Jeff Fahey","Roberta Maxwell","Hugh Gillin"],"backdrop_path":"https://image.tmdb.org/t/p/original/vzkuGQe1596nXK5pluip9OHwFXF.jpg","poster_path":"https://image.tmdb.org/t/p/original/NnUqiVpmUxPXh81yThpLVq0EBZ.jpg","certification":"16","genres":["Terror","Mistério","Thriller"],"trailer":"N/A"},
