"532870":{"id":"532870","name":"Corra, Querida, Corra","slug":"corra-querida-corra","original_title":"Run Sweetheart Run","overview":"Shari é uma trabalhadora mãe solteira que deixa suas melancolias de lado e resolve voltar ao cenário dos encontros a cegas, após uma pressão dos colegas de trabalho. Seu chefe arranja um encontro com Ethan, que se mostra muito atraente e charmoso. No entanto, algo inesperado acontece. Ethan não consegue esconder sua natureza por muito tempo, e as coisas ficam fora do controle. Shari, então, deve encontrar um modo de escapar. Forçada a navegar pelas ruas de LA, ela percebe que Ethan é mais perigoso e obsessivo do que parece.","first_air_date":"2020-01-27","runtime":103,"episode_run_time":[103],"vote_average":5.7,"created_by":["Blumhouse Productions","Automatik Entertainment","Quiet Girl Productions","Gamechanger Films","Stuck On On"],"production_companies":[{"name":"Blumhouse Productions"},{"name":"Automatik Entertainment"},{"name":"Quiet Girl Productions"},{"name":"Gamechanger Films"},{"name":"Stuck On On"}],"cast":["Ella Balinska","Pilou Asbæk","Clark Gregg","Shohreh Aghdashloo","Dayo Okeniyi"],"backdrop_path":"https://image.tmdb.org/t/p/original/oKqsZr4Jq1Y3fPZ0ufgzUs2ToK2.jpg","poster_path":"https://image.tmdb.org/t/p/original/bDkdcKOFSUaeQLgX3HuDXmxaq1d.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"lhxX_JilzqY"},
