"2800":{"id":"2800","name":"Dizem por aí...","slug":"dizem-por-ai","original_title":"Rumor Has It...","overview":"Após um longo tempo, enfim Sarah Huttinger (Jennifer Aniston) aceitou se casar com Jeff (Mark Ruffalo), seu namorado. Mas na verdade ela ainda está em dúvida sobre se realmente quer se casar. Sua vida profissional também está confusa, já que Sarah é uma aspirante a jornalista e não consegue deixar a área de obituários do New York Times. Para piorar ainda mais a situação ela precisa ir ao casamento de sua irmã, o que significa ter que passar bastante tempo com sua família, o que sempre a deixou deslocada. Porém sua vida muda quando conhece o milionário Beau Burroughs (Kevin Costner), que a ajuda a conhecer quem realmente é e a conhecer melhor sua família.","first_air_date":"2005-12-22","runtime":97,"episode_run_time":[97],"vote_average":5.7,"created_by":["Village Roadshow Pictures","Section Eight","Spring Creek Pictures","Warner Bros. Pictures","Munich Hoffmann-Media"],"production_companies":[{"name":"Village Roadshow Pictures"},{"name":"Section Eight"},{"name":"Spring Creek Pictures"},{"name":"Warner Bros. Pictures"},{"name":"Munich Hoffmann-Media"}],"cast":["Jennifer Aniston","Kevin Costner","Shirley MacLaine","Mark Ruffalo","Richard Jenkins"],"backdrop_path":"https://image.tmdb.org/t/p/original/rBMTI89Y5GkiKIP9XB0PMkUag9w.jpg","poster_path":"https://image.tmdb.org/t/p/original/4MD9Z7tEpc6IcpJTjbJ39aPz9Zs.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
