"492336":{"id":"492336","name":"Do Fundo do Mar 2","slug":"do-fundo-do-mar-2","original_title":"Deep Blue Sea 2","overview":"Preservadora de tubarões, a Dr. Misty Calhoun é convidada para ser consultora num projeto ultra-secreto do bilionário farmacêutico Carl Durant. Ela acredita que o projeto, situado numa base subaquática, foca na extração de anticorpos dos tubarões para ajudar na cura de doenças humanas. Contudo, Misty fica espantada ao descobrir que a companhia está usando os imprevisíveis tubarões-cabeça-chata como teste e que Durant está usando bio-genética neles para gerar tubarões altamente inteligentes e rápidos, além de altamente agressivos.","first_air_date":"2018-04-17","runtime":94,"episode_run_time":[94],"vote_average":5.1,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Danielle Savre","Rob Mayes","Michael Beach","Nathan Lynn","Kim Syster"],"backdrop_path":"https://image.tmdb.org/t/p/original/5UKLqsKJIhouJPVr8AQSTuh7S4n.jpg","poster_path":"https://image.tmdb.org/t/p/original/xygBIZm05PruPcmNjekb6aXBk6f.jpg","certification":"16","genres":["Ação","Terror","Ficção científica"],"trailer":"N/A"},
