"9059":{"id":"9059","name":"Os Demônios da Noite","slug":"os-demonios-da-noite","original_title":"Tales from the Crypt: Demon Knight","overview":"Primeiro longa-metragem baseado no seriado Contos da Cripta. Numa pequena cidade no Novo México, o demônio persegue um homem, escolhido para guardar uma chave que tem o sangue de Cristo. A perseguição os leva até uma pensão, onde o demônio acorda algumas criaturas para ajudá-lo a adquirir a chave..","first_air_date":"1995-01-13","runtime":92,"episode_run_time":[92],"vote_average":6.9,"created_by":["Tales From The Crypt Holdings","Universal Pictures"],"production_companies":[{"name":"Tales From The Crypt Holdings"},{"name":"Universal Pictures"}],"cast":["Billy Zane","William Sadler","Jada Pinkett Smith","CCH Pounder","Brenda Bakke"],"backdrop_path":"https://image.tmdb.org/t/p/original/47WfbtmsreEhNy2OzEDBxk9ZlzG.jpg","poster_path":"https://image.tmdb.org/t/p/original/d589sNe1f2r2arMKLnmuMjHbyGx.jpg","certification":"N/A","genres":["Terror","Comédia","Thriller"],"trailer":"N/A"},
"421":{"id":"421","name":"A Vida Marinha com Steve Zissou","slug":"a-vida-marinha-com-steve-zissou","original_title":"The Life Aquatic with Steve Zissou","overview":"Steve Zissou é um lendário explorador subaquático, famoso pelos seus rompantes de temperamento e também pelos documentários que faz sobre a vida no fundo dos oceanos. Entretanto os últimos dias não têm sido felizes para Zissou. Esteban, seu melhor amigo e parceiro de longa data, foi recentemente devorado por um tubarão-jaguar. Além disto Zissou precisa lidar com os boatos de que está perdendo seu talento, sem contar o súbito aparecimento de Ned Plimpton, um co-piloto que diz ser seu filho nunca visto. Em meio a todos estes problemas Zissou se prepara para realizar seu maior épico cinematográfico, que permitirá que recupere sua nobreza, seja o pai que nunca imaginou poder ser e ainda por cima se vingue do tubarão-jaguar.","first_air_date":"2004-12-10","runtime":119,"episode_run_time":[119],"vote_average":7.1,"created_by":["American Empirical Pictures","Touchstone Pictures","Scott Rudin Productions"],"production_companies":[{"name":"American Empirical Pictures"},{"name":"Touchstone Pictures"},{"name":"Scott Rudin Productions"}],"cast":["Bill Murray","Owen Wilson","Cate Blanchett","Anjelica Huston","Willem Dafoe"],"backdrop_path":"https://image.tmdb.org/t/p/original/joOlYI5hPsc7txTRFSR8e1wNniV.jpg","poster_path":"https://image.tmdb.org/t/p/original/3uIr6KAAkZ4cQfMA8UJUW00nJpa.jpg","certification":"14","genres":["Aventura","Comédia","Drama"],"trailer":"N/A"},
"520360":{"id":"520360","name":"Rei dos Ladrões","slug":"rei-dos-ladroes","original_title":"King of Thieves","overview":"Baseado em fatos reais, o filme traz a história de uma equipe de ladrões aposentados que decidem realizar um grande assalto no distrito de joias de Londres. Em 2015, uma quadrilha realizou um roubo no Hatton Garden Safe Deposit Company, uma instalação subterrânea de depósito seguro na área de Hatton Garden, em Londres. A mídia acreditava que o roubo tinha sido realizado por um grupo de criminosos atuais. Na verdade, os autores reais eram aposentados de 60 e 70 anos, e com diversas doenças. A invasão foi feita através de um poço do elevador, e o valor do roubo foi estimado em torno de 200 milhões de libras.","first_air_date":"2018-09-04","runtime":108,"episode_run_time":[108],"vote_average":5.5,"created_by":["Working Title Films","StudioCanal","Creative Europe Media"],"production_companies":[{"name":"Working Title Films"},{"name":"StudioCanal"},{"name":"Creative Europe Media"}],"cast":["Michael Caine","Jim Broadbent","Tom Courtenay","Charlie Cox","Paul Whitehouse"],"backdrop_path":"https://image.tmdb.org/t/p/original/429x9ZU5IQY6L0HGshBGY1LQpjB.jpg","poster_path":"https://image.tmdb.org/t/p/original/hkI8oBMIOAnCEJFbgFgI7IZ302G.jpg","certification":"12","genres":["Crime","Drama"],"trailer":"giuOp24v0ik"},
"8988":{"id":"8988","name":"Stop-Loss: A Lei da Guerra","slug":"stop-loss-a-lei-da-guerra","original_title":"Stop-Loss","overview":"O Sargento Brandon King (Ryan Phillippe) é muito bem recebido em sua cidade, no interior do Texas, após voltar da guerra no Iraque. Ele tenta retomar a vida de deixou pra trás com a ajuda e o apoio de sua família e de seu melhor amigo, Steve Shriver (Channing Tatum), que serviu com ele no Oriente Médio. Aos poucos eles vão conseguindo se adaptar à vida de civil até que o exército chama Brandon de volta para o Iraque. A ordem para voltar ao serviço militar mexe com suas certezas, mas, mesmo contrariado, Brandon cumpre seu dever. Essa situação põe em xeque tudo que ele acredita: lealdade à família e aos amigos, os limites do amor e o valor da honra.","first_air_date":"2008-03-28","runtime":112,"episode_run_time":[112],"vote_average":6.1,"created_by":["MTV Films","Peirce Pictures","Paramount Pictures","Scott Rudin Productions"],"production_companies":[{"name":"MTV Films"},{"name":"Peirce Pictures"},{"name":"Paramount Pictures"},{"name":"Scott Rudin Productions"}],"cast":["Ryan Phillippe","Abbie Cornish","Joseph Gordon-Levitt","Channing Tatum","Josef Sommer"],"backdrop_path":"https://image.tmdb.org/t/p/original/bMkwq0BYNHgdU9zhOFGr3Q4V85s.jpg","poster_path":"https://image.tmdb.org/t/p/original/fTqD0qCha2tCegvZmQ6t5Mn66uz.jpg","certification":"N/A","genres":["Drama","Guerra"],"trailer":"N/A"},
