"10643":{"id":"10643","name":"Godzilla 2000","slug":"godzilla-2000","original_title":"ゴジラ2000 ミレニアム","overview":"Orga, um terrível monstro alienígena, acorda depois de 6.000 anos adormecido nas profundezas do oceano, e ameaça destruir Tóquio com fúria descomunal. Então, Godzilla ressurge como a única esperança contra essa terrível ameaça e a humanidade, completamente indefesa, só pode torcer para que o planeta fique a salvo após essa grande batalha.","first_air_date":"1999-12-11","runtime":107,"episode_run_time":[107],"vote_average":6.9,"created_by":["Toho Pictures"],"production_companies":[{"name":"Toho Pictures"}],"cast":["村田雄浩","西田尚美","Mayu Suzuki","阿部寛","佐野史郎"],"backdrop_path":"https://image.tmdb.org/t/p/original/Sgrm5eXevPpszHUYJFNUGnJSPU.jpg","poster_path":"https://image.tmdb.org/t/p/original/wlHr0MAMr6xfC628LKLaA9mWM6w.jpg","certification":"12","genres":["Ação","Aventura","Ficção científica"],"trailer":"N/A"},
