"19124":{"id":"19124","name":"Fúria Cega","slug":"furia-cega","original_title":"Blind Fury","overview":"Nick Parker (Rutger Hauer) foi dado como desaparecido em combate por mais de duas décadas, após ter sido abandonado, cego e moribundo no Vietnam. Quando finalmente regressa a casa, decide procurar e perdoar o seu ex-companheiro de exército, Frank Devereaux (Terrance O'Quinn).Este encontra-se sob o domínio de um corrupto diretor de um casino, que o obriga a manipular drogas. Mas Devereaux tenta fugir, colocando a sua ex-mulher e o seu filho em perigo. Apanhado no meio do caos e perseguido pelos criminosos Nick aproveita a sua capacidade sensorial superior para escapar de uma batalha cheia de acção.","first_air_date":"1989-08-17","runtime":86,"episode_run_time":[86],"vote_average":6.6,"created_by":["Interscope Communications","TriStar Pictures","Daniel Grodnik Productions"],"production_companies":[{"name":"Interscope Communications"},{"name":"TriStar Pictures"},{"name":"Daniel Grodnik Productions"}],"cast":["Rutger Hauer","Terry O'Quinn","Brandon Call","Charles Cooper","Noble Willingham"],"backdrop_path":"https://image.tmdb.org/t/p/original/rrnya09qUcArCReu2Xvy6tedmPu.jpg","poster_path":"https://image.tmdb.org/t/p/original/6v8xwGriYLxyJc0AiQFX3cx6r9l.jpg","certification":"N/A","genres":["Ação","Thriller"],"trailer":"N/A"},
"517991":{"id":"517991","name":"O Espião que foi para o Norte","slug":"o-espiao-que-foi-para-o-norte","original_title":"공작","overview":"Em 1993, a Guerra Fria continuava na Coreia. Seok-young Park (Hwang Jung-Min), é um espião militar da Coreia do Sul enviado ao país inimigo (Coreia do Norte), sob o disfarce de empresário. Sua missão é descobrir os segredos relacionados ao desenvolvimento de armas nucleares pelo regime comunista. Com o tempo, ele ganha a confiança dos norte coreanos e consegue se infiltrar dentro de uma instalação nuclear, até então, secreta.","first_air_date":"2018-08-08","runtime":138,"episode_run_time":[138],"vote_average":7.4,"created_by":["Sanai Pictures","Moonlight Film","CJ Entertainment"],"production_companies":[{"name":"Sanai Pictures"},{"name":"Moonlight Film"},{"name":"CJ Entertainment"}],"cast":["황정민","이성민","조진웅","주지훈","정소리"],"backdrop_path":"https://image.tmdb.org/t/p/original/fReqenpUkU83y7rpEMscE5EjoDr.jpg","poster_path":"https://image.tmdb.org/t/p/original/9FmxOrwD3yOHo1MqtEDqsLXlNBp.jpg","certification":"N/A","genres":["Drama","História","Thriller"],"trailer":"N/A"},
