"866":{"id":"866","name":"Em Busca da Terra do Nunca","slug":"em-busca-da-terra-do-nunca","original_title":"Finding Neverland","overview":"J.M. Barrie (Johnny Depp) é um bem-sucedido autor de peças teatrais, que apesar da fama que possui está enfrentando problemas com seu trabalho mais recente, que não foi bem recebido pelo público. Em busca de inspiração para uma nova peça, Barrie a encontra ao fazer sua caminhada diária pelos jardins Kensington, em Londres. É lá que ele conhece a família Davies, formada por Sylvia (Kate Winslet), que enviuvou recentemente, e seus quatro filhos. Barrie logo se torna amigo da família, ensinando às crianças alguns truques e criando histórias fantásticas para eles, envolvendo castelos, reis, piratas, vaqueiros e naufrágios. Inspirado por esta convivência, Barrie cria seu trabalho de maior sucesso: Peter Pan.","first_air_date":"2004-10-17","runtime":106,"episode_run_time":[106],"vote_average":7.3,"created_by":["Miramax","FilmColony","Mirimax"],"production_companies":[{"name":"Miramax"},{"name":"FilmColony"},{"name":"Mirimax"}],"cast":["Johnny Depp","Kate Winslet","Julie Christie","Dustin Hoffman","Freddie Highmore"],"backdrop_path":"https://image.tmdb.org/t/p/original/w8FnI0SWivynvfu3vYluc4LLSoL.jpg","poster_path":"https://image.tmdb.org/t/p/original/w2Jjcm1OOgn1NWHdKk8LmKwgSm9.jpg","certification":"12","genres":["Drama","Fantasia"],"trailer":"Vo9-3mMx9Jo"},
