"13765":{"id":"13765","name":"Adorável Avarento","slug":"adoravel-avarento","original_title":"Scrooge","overview":"O espírito de Natal transforma-se em uma celebração musical da vida, nesta empolgante adaptação de Um Conto de Natal, o adorável clássico de Charles Dickens. O maldoso e sarcástico Ebeneezer Scrooge (Albert Finney) tem sempre a cara fechada e uma atitude falsa para qualquer um que cruze seu caminho. Mas naquela noite de Natal, ele vai conhecer o terrível destino que o aguarda se continuar com sua avareza. Um a um, os fantasmas do Natal Passado, Presente e Futuro levam o atônito Ebeneezer a uma incrível viagem no tempo – mostrando a ele, em uma única e mágica noite, o que levaria a vida inteira para ensinar. Enriquecido por onze alegres canções e um elenco que inclui Sir Alec Guinness, Dame Edith Evans e Kenneth More, esta adorável história certamente vai encantar a vida de jovens e adultos por muitas gerações.","first_air_date":"1970-11-05","runtime":113,"episode_run_time":[113],"vote_average":6.9,"created_by":["Cinema Center Films","Waterbury Films"],"production_companies":[{"name":"Cinema Center Films"},{"name":"Waterbury Films"}],"cast":["Albert Finney","Alec Guinness","Edith Evans","Kenneth More","Laurence Naismith"],"backdrop_path":"https://image.tmdb.org/t/p/original/bHHyjodPqQVlNiRR9g6L5ar5JOy.jpg","poster_path":"https://image.tmdb.org/t/p/original/bJxpPOifFvIc0OJCMhQtRGiWexu.jpg","certification":"N/A","genres":["Fantasia","Drama","Família"],"trailer":"N/A"},
