"14914":{"id":"14914","name":"Jogada de Gênio","slug":"jogada-de-genio","original_title":"Flash of Genius","overview":"Nos anos de 1960, em Detroit (Michigan), Robert Kearns (Greg Kinnear) formou uma típica família americana na esperança de alcançar o Sonho Americano. Professor em uma universidade local, Robert casou-se com a também professora Phyllis (Lauren Graham) e, com seus 30 e poucos anos de idade, já tinha seis filhos. Engenheiro de formação e um inventor nas horas vagas, Robert criou um dispositivo que seria utilizado em todos os carros do mundo. Para a família Kearns era como se tivessem encontrado ouro. Mas o grande desafio viria quando o jovem engenheiro foi simplesmente ignorado pelas gigantes montadoras de automóveis, sem antes se apropriar daquele invento. Baseado em fatos reais, o filme descreve a história de um homem que desafiou a indústria automobilística americana, lutando por seus direitos e pelo seu reconhecimento.","first_air_date":"2008-09-07","runtime":119,"episode_run_time":[119],"vote_average":6.5,"created_by":["Strike Entertainment","Universal Pictures","Spyglass Entertainment","Intermittent Productions"],"production_companies":[{"name":"Strike Entertainment"},{"name":"Universal Pictures"},{"name":"Spyglass Entertainment"},{"name":"Intermittent Productions"}],"cast":["Greg Kinnear","Lauren Graham","Dermot Mulroney","Jake Abel","Daniel Roebuck"],"backdrop_path":"https://image.tmdb.org/t/p/original/ApZcctYdXNkRTjQH5Yr6eFMkmYk.jpg","poster_path":"https://image.tmdb.org/t/p/original/qQPv850VUbbTnikPGl6qNb7qgQW.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
