"746524":{"id":"746524","name":"Sede Sem Fim","slug":"sede-sem-fim","original_title":"Blood","overview":"Jess, uma enfermeira que recentemente se separou de seu marido e se mudou com seus dois filhos, Tyler e Owen, de volta para sua antiga fazenda. Logo após chegarem lá, o cachorro de Owen foge para a floresta e retorna dias depois, raivoso e cheio de sangue. Quando ele morde o Owen, o ataque resulta em uma infecção que altera o comportamento do jovem de um jeito alarmante e mortal. Enquanto ele sucumbe aos sintomas de sua misteriosa doença, Jess descobre uma cura perturbadora, que a fará se questionar até onde ela está disposta a ir para manter seu filho vivo.","first_air_date":"2023-01-12","runtime":108,"episode_run_time":[108],"vote_average":6.5,"created_by":["H2L Media Group","Rhea Films","Hercules Film Fund","1821 Pictures","Thundersnow Pictures"],"production_companies":[{"name":"H2L Media Group"},{"name":"Rhea Films"},{"name":"Hercules Film Fund"},{"name":"1821 Pictures"},{"name":"Thundersnow Pictures"}],"cast":["Michelle Monaghan","Skeet Ulrich","Finlay Wojtak-Hissong","Skylar Morgan Jones","June B. Wilde"],"backdrop_path":"https://image.tmdb.org/t/p/original/tNWZ1fyKYl2zWRWsyXTTH7OwuQr.jpg","poster_path":"https://image.tmdb.org/t/p/original/ocuh1V9ddIF7YiXk0s0PpKr7mpH.jpg","certification":"N/A","genres":["Terror","Mistério","Thriller"],"trailer":"N/A"},
"9711":{"id":"9711","name":"A Experiência III","slug":"a-experiencia-iii","original_title":"Species III","overview":"A filha de Eve (Natasha Henstridge), Sara (Sunny Mabrey), faz parte da 3ª geração de alienígenas na Terra. Existem outros da sua espécie, mas Sara é mais resistente aos diversos tipos de doença do planeta. Ela vive na casa de um professor universitário, Abbot (Robert Knepper), que a seqüestrou do governo quando era apenas um bebê, ou seja, poucos dias atrás, pois ela cresce 15 centímetros por dia e em breve será uma adulta. Abbot quer criar o espécime perfeito e obter reconhecimento internacional, mas várias coisas começam a dar totalmente e mortes acontecem. Além disto outros alienígenas mestiços começam a apresentar sérios problemas de saúde, mas uma dela, Amelia (Amelia Cooke), parece estar disposta a tudo para poder sobreviver.","first_air_date":"2004-11-26","runtime":111,"episode_run_time":[111],"vote_average":5.2,"created_by":["FGM Entertainment","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"FGM Entertainment"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Robin Dunne","Robert Knepper","Sunny Mabrey","Amelia Cooke","Christopher Neame"],"backdrop_path":"https://image.tmdb.org/t/p/original/oG6k53yiliCN9RMmcGFyXeQhZNn.jpg","poster_path":"https://image.tmdb.org/t/p/original/eH7pQTCwenRToalvPAreFjdHDmG.jpg","certification":"N/A","genres":["Ficção científica","Ação","Terror"],"trailer":"N/A"},
