"760926":{"id":"760926","name":"Deserto do Ouro","slug":"deserto-do-ouro","original_title":"Gold","overview":"Dois estranhos que estão viajando em um deserto e se surpreendem ao encontrar uma grande pepita de ouro. Eles pensam em uma estratégia para explorar e dividir a recompensa do tesouro encontrado. Enquanto um vai procurar equipamentos para dar continuidade no plano, o outro fica responsável por proteger o local e ambos lidam com diversos desafios nessa aventura.","first_air_date":"2022-01-13","runtime":97,"episode_run_time":[97],"vote_average":6.2,"created_by":["Deeper Water","Rogue Star Productions","Screen Australia","Stan","South Australian Film Corporation"],"production_companies":[{"name":"Deeper Water"},{"name":"Rogue Star Productions"},{"name":"Screen Australia"},{"name":"Stan"},{"name":"South Australian Film Corporation"}],"cast":["Zac Efron","Anthony Hayes","Susie Porter","Andreas Sobik","Akuol Ngot"],"backdrop_path":"https://image.tmdb.org/t/p/original/5Ou7l7iA3Ud2DzCmwU3OgqU8jIx.jpg","poster_path":"https://image.tmdb.org/t/p/original/m33nZp0j2AbNxL6A8IDIb5KVDg9.jpg","certification":"16","genres":["Ação","Aventura","Thriller"],"trailer":"xNgQlhbOU78"},
