"13012":{"id":"13012","name":"Felon","slug":"felon","original_title":"Felon","overview":"Wade Porter está prestes a se casar, mas o sonho vira pesadelo quando ele, acidentalmente, mata um assaltante que invadira sua casa. Sentenciado a três anos de prisão, as coisas pioram quando um acidente no ônibus que iria levá-lo ao seu cárcere, faz com que ele acaba na ala de segurança máxima controlada por um corrupto tenente.","first_air_date":"2008-07-17","runtime":104,"episode_run_time":[104],"vote_average":7.2,"created_by":["Pantry Films","Stage 6 Films","Tooley Productions"],"production_companies":[{"name":"Pantry Films"},{"name":"Stage 6 Films"},{"name":"Tooley Productions"}],"cast":["Stephen Dorff","Val Kilmer","Harold Perrineau","Marisol Nichols","Johnny Lewis"],"backdrop_path":"https://image.tmdb.org/t/p/original/petZXpswyEMya01VPVBfp82lAer.jpg","poster_path":"https://image.tmdb.org/t/p/original/1eYGh6DETJFXQt5PWjV8lp8YZvx.jpg","certification":"16","genres":["Crime","Drama","Thriller","Ação"],"trailer":"N/A"},
"21786":{"id":"21786","name":"Presos no Gelo","slug":"presos-no-gelo","original_title":"Fritt vilt","overview":"Os amigos Jannicke (Ingrid Bolsø Berdal), Eirik (Tomas Alf Larsen), Mikail (Endre Martin Midtstigen), Ingunn (Viktoria Winge), e Morten Tobias (Rolf Kristian Larsen) resolvem esquiar nas montanhas durante o inverno. Só que Morten sofre um acidente e acaba quebrando a perna, o que faz com que todos parem suas atividades e procurem um abrigo para passar a noite. Eles então encontram um hotel abandonado no meio do nada, e descobrem que ele está fechado desde 1975, quando o garoto que morava lá desapareceu nas montanhas. No entanto, quando eles acordam na manhã seguinte, eles percebem que estão presos no hotel com um assassino psicopata, e que terão que se proteger para sobreviver.","first_air_date":"2006-10-13","runtime":97,"episode_run_time":[97],"vote_average":6.2,"created_by":["Fantefilm"],"production_companies":[{"name":"Fantefilm"}],"cast":["Ingrid Bolsø Berdal","Rolf Kristian Larsen","Tomas Alf Larsen","Endre Martin Midtstigen","Viktoria Winge"],"backdrop_path":"https://image.tmdb.org/t/p/original/u0zJm9HDy638Yg1mGwi9qIL6yoL.jpg","poster_path":"https://image.tmdb.org/t/p/original/6X0TwnQaakgb1DrdIzbMZuSUqzZ.jpg","certification":"N/A","genres":["Terror","Mistério","Thriller"],"trailer":"N/A"},
"11259":{"id":"11259","name":"Um Sonho Distante","slug":"um-sonho-distante","original_title":"Far and Away","overview":"A trama se passa em 1892 e tem início na Irlanda. Joseph Donnelly é um jovem analfabeto que se revolta contra um poderoso proprietário de terras, por considerá-lo responsável pela morte de seu pai. Durante um duelo, uma jovem passa com uma carroça e salva a sua vida. Insatisfeitos com a vida que levavam, eles decidem partir para os Estados Unidos, atrás do sonho americano.","first_air_date":"1992-05-22","runtime":140,"episode_run_time":[140],"vote_average":6.8,"created_by":["Imagine Entertainment","Universal Pictures"],"production_companies":[{"name":"Imagine Entertainment"},{"name":"Universal Pictures"}],"cast":["Tom Cruise","Nicole Kidman","Thomas Gibson","Robert Prosky","Barbara Babcock"],"backdrop_path":"https://image.tmdb.org/t/p/original/1MTBsjWk2nlcRLrAvgpB1uj00TC.jpg","poster_path":"https://image.tmdb.org/t/p/original/1INZsj5unvyvpaetQvl2JOmiiej.jpg","certification":"N/A","genres":["Aventura","Drama","Romance","Faroeste"],"trailer":"N/A"},
