"390053":{"id":"390053","name":"Crash Pad: Dando o Troco","slug":"crash-pad-dando-o-troco","original_title":"Crash Pad","overview":"O jovem romântico Stensland (Gleeson) acredita no amor verdadeiro quando conhece e se apaixona por Morgan (Christina Applegate), uma mulher mais velha. Mas tudo muda quando ele descobre que a mulher é casada e usa ele e o relacionamento deles para fazer ciúmes no marido, Grady (Thomas Haden Church).","first_air_date":"2017-10-27","runtime":93,"episode_run_time":[93],"vote_average":5.6,"created_by":["Indomitable Entertainment","Wonderful Films"],"production_companies":[{"name":"Indomitable Entertainment"},{"name":"Wonderful Films"}],"cast":["Domhnall Gleeson","Christina Applegate","Thomas Haden Church","Nina Dobrev","Dan Gill"],"backdrop_path":"https://image.tmdb.org/t/p/original/ryxQnjjh8gtU94uif5E9f8h01Dt.jpg","poster_path":"https://image.tmdb.org/t/p/original/tz36oaM0QIUzxiBvufDZ91UHzHO.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"8850":{"id":"8850","name":"O Sombra","slug":"o-sombra","original_title":"The Shadow","overview":"Nos anos 1930, na cidade de Nova York, o milionário Lamont Cranston (Alec Baldwin) usa poderes ocultos para se tornar \"O Sombra\", um misterioso vigilante. Seu objetivo é fazer justiça e impedir que seu arqui-inimigo Shiwan Khan (John Lone), descendente de Genghis Khan, detone uma bomba atômica e domine o mundo. Para isso, o herói vai usar sua habilidades de invisibilidade e de confundir mentes para salvar a cidade ameaçada das mãos desse terrível vilão.","first_air_date":"1994-07-01","runtime":103,"episode_run_time":[103],"vote_average":6.1,"created_by":["Bregman/Baer Productions","Universal Pictures"],"production_companies":[{"name":"Bregman/Baer Productions"},{"name":"Universal Pictures"}],"cast":["Alec Baldwin","John Lone","Penelope Ann Miller","Peter Boyle","Ian McKellen"],"backdrop_path":"https://image.tmdb.org/t/p/original/j3CMtQbRS4bBAuRuoTBpnPAaHSj.jpg","poster_path":"https://image.tmdb.org/t/p/original/lmIQJ2jcp50CbmaJ1fNnV5akYk3.jpg","certification":"N/A","genres":["Fantasia","Ação","Aventura","Crime","Mistério","Thriller"],"trailer":"N/A"},
"2897":{"id":"2897","name":"A Volta ao Mundo em Oitenta Dias","slug":"a-volta-ao-mundo-em-oitenta-dias","original_title":"Around the World in Eighty Days","overview":"Em 1872, o nobre inglês Phileas Fogg (David Niven) aposta vinte mil libras com seus colegas do Clube Reformatório de Londres de que ele consegue dar a volta no planeta em exatamente oitenta dias. Ao lado do engenhoso Valet Passepartout (Mario Moreno), ele busca cumprir o seu objetivo com aventuras em todos os continentes, acaba conhecendo e se encantando pela bela viúva Aouda (Shirley MacLaine), ao mesmo tempo que, em uma conspiração, é acusado de ter roubado o dinheiro que investiu na aposta.","first_air_date":"1956-10-17","runtime":175,"episode_run_time":[175],"vote_average":6.6,"created_by":["Michael Todd Company"],"production_companies":[{"name":"Michael Todd Company"}],"cast":["David Niven","Cantinflas","Finlay Currie","Robert Morley","Charles Boyer"],"backdrop_path":"https://image.tmdb.org/t/p/original/lj7aURTTktw8IRXiV1WYCxdEBKX.jpg","poster_path":"https://image.tmdb.org/t/p/original/zYRoEDPEGBgPWjRTvTO9yKB895U.jpg","certification":"L","genres":["Aventura","Comédia","Família","Fantasia","Romance"],"trailer":"N/A"},
"463319":{"id":"463319","name":"A Sombra do Reino","slug":"a-sombra-do-reino","original_title":"影","overview":"Se passa durante a era dos Três Reinos da China (anos 220 a 280). A história de um grande rei e seu povo, que será expulso de sua terra natal e desejará reivindicá-la. O rei, violento e ambicioso, de misteriosos métodos e motivos; seu general, um visionário que anseia por vencer a batalha final, mas precisa preparar seus planos em segredo; as mulheres do palácio, que lutam para encontrar a redenção em um mundo onde não têm lugar; e um plebeu chamado \"Senhor de Todo o Mundo\", serão os personagens ao redor que transformam as forças inexoráveis dessa história. (e 16 - Estimado 16 Anos)","first_air_date":"2018-09-30","runtime":117,"episode_run_time":[117],"vote_average":6.7,"created_by":["Village Roadshow Pictures Asia","LeVision Pictures","Bona Film Group","Perfect Village Entertainment","Tencent Pictures"],"production_companies":[{"name":"Village Roadshow Pictures Asia"},{"name":"LeVision Pictures"},{"name":"Bona Film Group"},{"name":"Perfect Village Entertainment"},{"name":"Tencent Pictures"}],"cast":["Deng Chao","孫儷","鄭愷","王千源","王景春"],"backdrop_path":"https://image.tmdb.org/t/p/original/neJywSBozU8mhBu04K4jO9Hxf0J.jpg","poster_path":"https://image.tmdb.org/t/p/original/tPLJkGizpxkeXyUvWMY6VMVydaS.jpg","certification":"14","genres":["Ação","Guerra"],"trailer":"iQnn-0WX5K4"},
