"340022":{"id":"340022","name":"Gringo: Vivo ou Morto","slug":"gringo-vivo-ou-morto","original_title":"Gringo","overview":"Funcionário dedicado e marido exemplar, Harold Soyinka leva uma vida pacata em Chicago. Enfrentando problemas financeiros, ele descobre que a empresa em que trabalha está negociando uma fusão que pode resultar em sua demissão. Aos poucos David passa a acreditar nesta possibilidade, devido a atos suspeitos de seu chefe e \"melhor amigo\" Richard Rusk. Quando Richard e sua sócia Elaine Markinson resolvem acompanhá-lo em uma viagem de trabalho corriqueira ao México, David vê a situação como a oportunidade ideal para fingir ter sido sequestrado e, desta forma, pedir um polpudo sequestro.","first_air_date":"2018-03-08","runtime":103,"episode_run_time":[103],"vote_average":5.9,"created_by":["Denver & Delilah Productions","Amazon Studios","Picrow","STXfilms"],"production_companies":[{"name":"Denver & Delilah Productions"},{"name":"Amazon Studios"},{"name":"Picrow"},{"name":"STXfilms"}],"cast":["David Oyelowo","Joel Edgerton","Charlize Theron","Amanda Seyfried","Sharlto Copley"],"backdrop_path":"https://image.tmdb.org/t/p/original/4zGmfaRPYn9DL9f3e05sNIguU0M.jpg","poster_path":"https://image.tmdb.org/t/p/original/8EXWz4TM3FRuxuJ5j0SBkQ1dR0P.jpg","certification":"16","genres":["Comédia","Ação","Crime"],"trailer":"N/A"},
"9920":{"id":"9920","name":"Ultravioleta","slug":"ultravioleta","original_title":"Ultraviolet","overview":"Uma mulher no meio de uma guerra civil futurística entre o governo e uma subcultura de humanos geneticamente modificados dotados de mais velocidade, força e inteligência. Na tentativa de proteger um garoto que foi jurado de morte, ela precisa se defender do governo humano.","first_air_date":"2006-03-03","runtime":87,"episode_run_time":[87],"vote_average":5.2,"created_by":["Ultravi Productions","Screen Gems","Salon Films"],"production_companies":[{"name":"Ultravi Productions"},{"name":"Screen Gems"},{"name":"Salon Films"}],"cast":["Milla Jovovich","Cameron Bright","Nick Chinlund","Sebastien Andrieu","Ida Martin"],"backdrop_path":"https://image.tmdb.org/t/p/original/hKUOwCsNFfz6BDJqGu9aX3bRxts.jpg","poster_path":"https://image.tmdb.org/t/p/original/oUjrVXrASYin8N7kJZ3gqgxIeHp.jpg","certification":"12","genres":["Ficção científica","Ação","Thriller"],"trailer":"N/A"},
"687":{"id":"687","name":"Os Últimos Passos de um Homem","slug":"os-ultimos-passos-de-um-homem","original_title":"Dead Man Walking","overview":"A Irmã Helen Prejean, uma caridosa freira de New Orleans, é a conselheira espiritual de Matthew Poncelet, um assassino cruel, revoltado e complexo, que aguarda sua execução. A missão da irmã é ajudar a quem, como Matthew, precisa encontrar a salvação. Mas quando ela tenta navegar na sombria alma de Matthew, encontra uma densidade de maldade que a faz questionar até onde a redenção realmente pode ir. Ela conseguirá adiar a data fatal da execução o suficiente para ter tempo de salvar Matthew? Ou acabará descobrindo uma verdade que abalará os próprios preceitos pelos quais norteia sua vida?","first_air_date":"1995-12-29","runtime":122,"episode_run_time":[122],"vote_average":7.3,"created_by":["Havoc","PolyGram Filmed Entertainment","Working Title Films"],"production_companies":[{"name":"Havoc"},{"name":"PolyGram Filmed Entertainment"},{"name":"Working Title Films"}],"cast":["Susan Sarandon","Sean Penn","Robert Prosky","Raymond J. Barry","R. Lee Ermey"],"backdrop_path":"https://image.tmdb.org/t/p/original/8ehJKWn16Snw0JHJuhUb0kD7Nsm.jpg","poster_path":"https://image.tmdb.org/t/p/original/y8Xgpw5Reh1Kkv7AbeUjTSjaMFH.jpg","certification":"16","genres":["Drama"],"trailer":"N/A"},
"9451":{"id":"9451","name":"Eleição","slug":"eleicao","original_title":"Election","overview":"O professor Jim McAllister (Matthew Broderick) faz parte do conselho estudantil da escola George Washington Carver High, e recebeu três prêmios de \"Professor do Ano\" durante os doze anos de trabalho na escola. Tracy Flick (Reese Whiterspoon) é a ambiciosa aluna que quer a presidência do Conselho, mesmo tendo que passar por cima dos outros candidatos. Paul Metzler (Chris Klein) é um popular jogador de futebol que teve a perna fraturada em uma competição, e está na candidatura com o apoio do renomado professor. A competição para a candidatura cresce quando a irmã de Paul, Tammy, entra na disputa apenas para se vingar do irmão, atingindo, assim, sua vida dentro e fora do colégio.","first_air_date":"1999-04-23","runtime":104,"episode_run_time":[104],"vote_average":6.9,"created_by":["Paramount Pictures","MTV Films","Bona Fide Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"MTV Films"},{"name":"Bona Fide Productions"}],"cast":["Matthew Broderick","Reese Witherspoon","Chris Klein","Jessica Campbell","Mark Harelik"],"backdrop_path":"https://image.tmdb.org/t/p/original/lNPPNnYM3j0cb8IZ9CsJiDt0BK9.jpg","poster_path":"https://image.tmdb.org/t/p/original/tkI4S66hyoYw9r9cNavu34p4Rfz.jpg","certification":"14","genres":["Comédia","Romance","Drama","Mistério"],"trailer":"N/A"},
"18444":{"id":"18444","name":"A Cidadela dos Robinsons","slug":"a-cidadela-dos-robinsons","original_title":"Swiss Family Robinson","overview":"Depois de um naufrágio, a família Robinson fica abandonada em uma ilha habitada apenas por uma impressionante variedade de vida selvagem. Num verdadeiro espírito de pioneiro, eles rapidamente se sentem em casa, mas logo enfrentam um perigo ainda maior do que a natureza: piratas assustadores. É uma aventura estimulante, adequada para toda a família, adaptação Disney do romance clássico de Johann Wyss. Com as estrelas Dorothy McGuire e John Mills como mãe e pai Robinson.","first_air_date":"1960-12-21","runtime":126,"episode_run_time":[126],"vote_average":6.9,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["John Mills","Dorothy McGuire","James MacArthur","Janet Munro","Sessue Hayakawa"],"backdrop_path":"https://image.tmdb.org/t/p/original/vNijAksUUekLP0sMuuGctkSFK2L.jpg","poster_path":"https://image.tmdb.org/t/p/original/iX7dcRZQH5DZf3Y33Uv3poJY8LZ.jpg","certification":"N/A","genres":["Aventura","Família"],"trailer":"N/A"},
"10153":{"id":"10153","name":"Esfera","slug":"esfera","original_title":"Sphere","overview":"Um grupo de especialistas formado por um psicólogo, um matemático, uma bioquímica e um astrofísico são convocados pelo governo americano para analisarem uma espaçonave, que está a trezentos metros de profundidade no Oceano Pacífico. Mas ironicamente este grupo foi formado com base em um relatório bastante fantasioso elaborado pelo psicólogo, que apenas o redigiu para ajudar a pagar sua casa. Assim, este grupo, que nunca trabalhou junto, tem a tarefa de participar de uma missão ultra-secreta e se defronta com uma misteriosa esfera, que passa a influir nas suas vidas, despertando e tornando realidade seus maiores temores.","first_air_date":"1998-02-13","runtime":134,"episode_run_time":[134],"vote_average":6.1,"created_by":["Warner Bros. Pictures","Punch Productions","Baltimore Pictures","Constant c Productions"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Punch Productions"},{"name":"Baltimore Pictures"},{"name":"Constant c Productions"}],"cast":["Dustin Hoffman","Sharon Stone","Samuel L. Jackson","Peter Coyote","Liev Schreiber"],"backdrop_path":"https://image.tmdb.org/t/p/original/piGIiXsYrmBg65YxsfE4BBFvYyN.jpg","poster_path":"https://image.tmdb.org/t/p/original/7rl7xl0TCNHEh5k5jnHEB25eb0v.jpg","certification":"N/A","genres":["Ficção científica","Mistério","Thriller","Terror"],"trailer":"N/A"},
