"33473":{"id":"33473","name":"O Poder do Ritmo 2","slug":"o-poder-do-ritmo-2","original_title":"Stomp the Yard 2: Homecoming","overview":"Na reta final para decisão nacional de uma competição de dança, as rivalidades na Truth University estão inflamados. Os Theta Nus estão contando com Chance Harris (Collins Pennie) para levar a equipe à vitória. mas ele está muito concentrado em seus próprios problemas para prestar a atenção necessária na competição. Desentendimentos com seu pai, problemas amorosos e uma gangue de rua à sua procura, por causa de uma dívida, deixam a vida de Chance muito complicada. Agora ele precisa decidir o que é verdadeiramente importante e tomar as decisões que vão moldar sua vida futura. \"O Poder do Ritmo 2\" tem um elenco incrível, que conta com Terrence J e Pooch Hall, além de uma trilha sonora de arrasar!","first_air_date":"2010-10-10","runtime":90,"episode_run_time":[90],"vote_average":5.5,"created_by":["Sony Pictures","Rainforest Entertainment"],"production_companies":[{"name":"Sony Pictures"},{"name":"Rainforest Entertainment"}],"cast":["Kiely Williams","Tika Sumpter","Stephen 'tWitch' Boss","Collins Pennie","Columbus Short"],"backdrop_path":"https://image.tmdb.org/t/p/original/3FLjn066Q0WNDmqKsN1L9NCf5yg.jpg","poster_path":"https://image.tmdb.org/t/p/original/zdh5FNmEc4oRCR7stGraJTbc49j.jpg","certification":"N/A","genres":["Drama","Música"],"trailer":"N/A"},
