"1480":{"id":"1480","name":"A Marca da Maldade","slug":"a-marca-da-maldade","original_title":"Touch of Evil","overview":"Quando um carro-bomba explode no lado norte-americano da fronteira entre os EUA e o México, Miguel Vargas, o agente antidrogas mexicano, inicia sua investigação, junto com o capitão da polícia americana Hank Quinlan. Quando Vargas começa a suspeitar que Quinlan e seu parceiro obscuro, Menzies, estão plantando provas para enquadrar um homem inocente, suas investigações sobre sua possível corrupção rapidamente colocaram em risco a si e sua nova esposa, Susie.","first_air_date":"1958-03-30","runtime":111,"episode_run_time":[111],"vote_average":7.8,"created_by":["Universal International Pictures"],"production_companies":[{"name":"Universal International Pictures"}],"cast":["Charlton Heston","Janet Leigh","Orson Welles","Joseph Calleia","Akim Tamiroff"],"backdrop_path":"https://image.tmdb.org/t/p/original/ggYMULlCnIEjCpoHRN4MKgkHXvq.jpg","poster_path":"https://image.tmdb.org/t/p/original/1R5UICWr3ygzRWZKejySivuJ2Hv.jpg","certification":"16","genres":["Crime","Thriller","Mistério"],"trailer":"N/A"},
"10449":{"id":"10449","name":"Quando um Homem Ama uma Mulher","slug":"quando-um-homem-ama-uma-mulher","original_title":"When a Man Loves a Woman","overview":"Alice Green é uma esposa e mãe que desenvolve um problema de alcoolismo. Enquanto seu marido Michael tem sido paciente em lidar com o problema, logo se torna claro que ele contribui para o seu alcoolismo. Quando o vício ameaça a segurança de suas filhas, Alice decide ir para uma clínica de reabilitação. Ao retornar, percebe que o seu novo estilo de vida provoca um inesperado problema com Michael, levando-os a tentar descobrir o que sentem um pelo outro.","first_air_date":"1994-04-29","runtime":126,"episode_run_time":[126],"vote_average":6.5,"created_by":["Touchstone Pictures"],"production_companies":[{"name":"Touchstone Pictures"}],"cast":["Andy García","Meg Ryan","Tina Majorino","Philip Seymour Hoffman","Lauren Tom"],"backdrop_path":"https://image.tmdb.org/t/p/original/eS4ky6DOiDLr9mHMNJnFPRWo4D.jpg","poster_path":"https://image.tmdb.org/t/p/original/onkETu3jrDklSkiTcwsQ3pY9mgw.jpg","certification":"12","genres":["Drama","Romance"],"trailer":"N/A"},
"10367":{"id":"10367","name":"Garotas Selvagens 2","slug":"garotas-selvagens-2","original_title":"Wild Things 2","overview":"Blue Bay, uma cidade costeira na Flórida. Ao se saber que o milionário Nigel Dunlap (Anthony John Denison) morreu em um desastre de avião, todos pensam que sua fortuna de quase US$ 80 milhões irá para Brittney Havers (Susan Ward), sua enteada, pois há um ano sua mulher cometeu suicídio. Mas, para surpresa de todos, o testamento diz que Brittney só receberá US$ 25 mil por ano pelo resto da vida e que, na ausência de um descendente, todo o dinheiro irá para a caridade. Acontece então outra surpresa, pois Maya King (Lelia Arcieri), que sempre hostiliza Brittney, alega ser filha ilegítima de Nigel. Os exames de DNA confirmam, mas Terence Bridge (Isaiah Washington), um investigador de seguros, acha que algo não se encaixa e está disposto a tentar provar que a queda do avião não foi um acidente.","first_air_date":"2004-02-19","runtime":95,"episode_run_time":[95],"vote_average":5.2,"created_by":["TriStar Pictures","Destination Films","Mandalay Pictures","Magic Hour Pictures"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Destination Films"},{"name":"Mandalay Pictures"},{"name":"Magic Hour Pictures"}],"cast":["Susan Ward","Leila Arcieri","Isaiah Washington","Joe Michael Burke","Linden Ashby"],"backdrop_path":"https://image.tmdb.org/t/p/original/nmly11JCqU9WhbjYwKWXoWDsCgI.jpg","poster_path":"https://image.tmdb.org/t/p/original/dd1r08AnK6plTIIQiuEHa94Dc6O.jpg","certification":"N/A","genres":["Crime","Drama","Mistério"],"trailer":"N/A"},
